import Images from './images'

function Card(props){
    return (
      <>
        <div className='cards'>
          <div className='card'>
            <Images  img />
            <div className='card_info'>
              <span className='card_category'> 
                {props.title}
              </span>
              <h3 className='card_title'>{props.sname} </h3>
              <a href = {props.link}  target = '_blank'>
                <button> Watch Now </button>
  
              </a>
            </div>
          </div>
        </div>
      </>
    );
}

export default Card ;
